Description
La storia racconta di una coppia di ballerine di lap dance, Diana e sarah, che vivono una piacevole relazione sentimentale. Una sera al locale dove lavorano, arrivano un gruppo di ragazzi e subito nasce un'attrazione tra uno di loro e Diana. Sarah sentendosi tradita dalla propria amante decide di venticarsi concedendosi non solo all'amico di Diana ma anche ad un altro ragazzo del gruppo. La situazione creatasi genera tensioni tra tutti. Passata la bufera il gruppo si riunisce e decide di assoldare un' accompagnatrice per passare una serata di passione....(feel free to translate)
